import React from 'react'
import './App.css'
import '../node_modules/bootstrap/dist/css/bootstrap.min.css';
import { Provider } from 'react-redux';
import Store from './component/redux/Store';
import CardTable from './component/card-table/CardTable';
import MainPage from './component/card-table/main-page/MainPage';

function App() {
	return (
		<React.Fragment>
			<Provider store={Store}>
				{/* <CardTable /> */}
				<MainPage/>
			</Provider>
		</React.Fragment >
	)
}

export default App
